import React from "react";
import { useState } from "react";

function Navigator() {
    const [isDropdown, setIsDropdown] = React.useState(false)
    
    function handleIsDropdown() {
        setIsDropdown(state => !state)
    }//end method

console.log(isDropdown)
    return (
        <div className="">
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <button class="navbar-toggler" type="button" onClick={handleIsDropdown}>
                <span class="navbar-toggler-icon"></span>
            </button>
                <div className={(isDropdown && "collapse ")} id="navbarNavDropdown">
                    <ul className="navbar-nav">
                        <NavItem link="#" title="Home "/>
                        <NavItem link="#" title="Projects"/>
                        <NavItem link="#" title="Experience"/>
                        <NavItem link="#" title="About Me"/>
                        <NavItem link="#" title="Misc"/>
                        <NavItem link="#" title="Contact"/>
                    </ul>
                </div>
            </nav>
            <h6>FixedTopBar (Navigator)</h6>
        </div>
    )
}//end method

function NavItem(props) {
    let link = props.link
    let title = props.title

    return (
        <li className="nav-item">
            <a className="nav-link" href={link}>{title}</a>
        </li>
    )

}//end method

export default Navigator;
